import React from 'react'
import Container from 'react-bootstrap/Container';
import 'bootstrap/dist/css/bootstrap.min.css';
const Card = ({ image, text }) => {
  return (
    <div>
      <img src={image} />
      <p>{text}</p>
    </div>
  )
}

const Languages = () => {
  const proficientText = ["CSS", "React", "HTML", "JavaScript", "NodeJS", "MongoDB", "Discord"]
  const exploringText = ["Blender", "PostgreSQL", "VueJS", "Solidity"]

  return (
    <section id="languages">
      <div>
        <h4>I AM PROFICIENT IN</h4>
      </div>
      <div>
        <h4>AND EXPLORING</h4>
      </div>
    </section>
  )
}

export default Languages;
